Concept of Generics
Much like when you want to make a general analogy about a concept you can utilize Generics in Rust to generalize your Rust Programs.
We could specify a function and have functions that behave in the same exact way but that would be unnecessary if we can utilize generics.
You will typically see generics denoted by angle brackets and one letter Capitalized alphabet such as:
 => List of 
 => List of 

Generic Function
A function can be considered generic if it is preceded by a  before its parameters specified in (...) and its name:
// generic soldier
struct Soldier(T);

fn i_am_generic(s: Soldier) {}

Here we have a struct named Soldier that takes a generic of T and our function named i_am_generic takes a generic argument of T and specifies an argument of Soldier
Implementations
In order for implementation to be generic the  must precede the type like this:
struct Student {
    scores: &'a [T],
    name: U,
}

impl Student {
    fn get_scores(&self) -> &[T] {
        self.scores
    }
}

fn main() {
    let student = Student {
        scores: &vec![98, 99, 88, 85, 100],
        name: String::from("Jean-Claude Van Damme"),
    };

    let mut summation = 0;
    for score in student.get_scores().iter() {
        summation += score;
    }
    assert_eq!(summation / student.get_scores().len(), 94);
    assert_eq!(student.name, String::from("Jean-Claude Van Damme"));
}

Notice that here we have impl defined before the type declaration for the Student struct type.
Bounds

Trait and lifetime bounds provide a way for generic items to restrict which types and lifetimes are used as their parameters. Bounds can be provided on any type in a where clause. There are also shorter forms for certain common cases:

Trait Bounds specification
Traits Recap
We previously mentioned Traits earlier in the workshop on the Data Types -> Trait Types Section so please check it out if you skipped to this section and do not know what a Trait is..
struct Number {
    num1: i32,
    num2: i32,
}

trait Calculator {
    fn adder(&self) -> i32;
    fn subtracter(&self) -> i32;
}

impl Calculator for Number {
    fn adder(&self) -> i32 {
        self.num1 + self.num2
    }
    fn subtracter(&self) -> i32 {
        self.num1 - self.num2
    }
}

fn main() {
    let number = Number {
        num1: 5,
        num2: 4,
    };
    assert_eq!(number.adder(), 9);
    assert_eq!(number.subtracter(), 1);
}

traits example recap playground
Bounds example
#[derive(Debug,PartialEq)]
struct Army;

#[allow(dead_code)]
#[derive(Debug,PartialEq)]
struct Navy;

#[allow(dead_code)]
struct AirForce;

#[allow(dead_code)]
struct Marines;

#[allow(dead_code)]
struct CoastGuard;

trait Service {}

impl Service for Army {}

fn army(a: &T) -> &T {
    a
}

fn main() {
    let soldier = Army;
    // army is bound to Army and won't work with other services
    assert_eq!(&Army, army(&soldier));
}

Notice that Service is bound to Army here and not to other services.
Bounds example
Where Clauses
A Trait bound can be expressed using a where clause rather than at the Type Level .
A where clause can apply Trait bounds to arbitrary types and not just type parameters.
Here is how the where clause looks like in function:
// Example of where clause with function
fn func_thing(t: T, u: U) -> f32 
    where T: Display + Clone, U: Clone + Debug {

    }

Here is how the where clause looks like in implementation:
use std::fmt::Debug;

trait Dude {
    fn he_who_abides(self) -> String;
}

impl Dude for T where Option: Debug {
    fn he_who_abides(self) -> String {
        format!("{}", self)
    }
}

fn main() {
    let sentence = "The rug really tied the room together";
    let big_lebowski_phrase = String::from(sentence);
    assert_eq!(
        big_lebowski_phrase.he_who_abides(),
        sentence,
    );
}

Associated Items
Associated Types specification

Associated types are type aliases associated with another type. Associated types cannot be defined in inherent implementations nor can they be given a default implementation in traits.
An associated type definition defines a type alias on another type. It is written as type, then an identifier, then an =, and finally a type.

Associated Item example:
#[allow(dead_code)]
struct ServiceMember {
    branch: String,
    name: String,
    age: u32,
    rank: String,
    years_of_experience: u32,
}

trait MilitaryBranch {
    type Branch;

    fn member_of_branch(
        &self,
        _: &Self::Branch,
    ) -> String;
}

impl MilitaryBranch for ServiceMember {
    type Branch = String;

    fn member_of_branch(
        &self,
        branch: &String,

    ) -> String {
        match &self.branch {
            s if &self.branch == branch => format!("{} is in {}", &self.name, s),
            _ => format!("{}", "Branch not known"),
        }
    }
}

fn main() {
    let army_soldier = ServiceMember {
        branch: String::from("Army"),
        name: String::from("John Rambo"),
        age: 32,
        rank: String::from("SFC"),
        years_of_experience: 12,
    };
    let navy_soldier = ServiceMember {
        branch: String::from("Navy"),
        name: String::from("Fried Squid"),
        age: 21,
        rank: String::from("Ensign"),
        years_of_experience: 1,
    };
    let air_force_soldier = ServiceMember {
        branch: String::from("Air Force"),
        name: String::from("Chuck Norris"),
        age: 33,
        rank: String::from("Technical Sergeant"),
        years_of_experience: 10,
    };
    assert_eq!(
        army_soldier.member_of_branch(&String::from("Army")),
        "John Rambo is in Army",
    );
    assert_eq!(
        navy_soldier.member_of_branch(&String::from("Navy")),
        "Fried Squid is in Navy",
    );
    assert_eq!(
        air_force_soldier.member_of_branch(&String::from("Air Force")),
        "Chuck Norris is in Air Force",
    );
}

Associated Item playground
Phantom Types
Phantom type parameters are not checked at runtime but instead are checked statically and at compile time
Some Data types can use extra generic type parameters that serve as markers and these extra paramters do not hold storage values.
use std::ops::Div;
use std::marker::PhantomData;

// Creating empty enumerations so we can define a unit type
#[derive(Debug, Clone, Copy)]
enum Inch {}

#[derive(Debug, Clone, Copy)]
struct Length(f64, PhantomData);

// The `Div` trait defines the behavior of the `/` operator
impl Div for Length {
    type Output = Length;


    // div() returns a new `Length` containing the quotient
    // dividend divided by the divisor is equal to the quotient 
    // 12 / 2 = 6
    fn div(self, rhs: Length) -> Length {
        // `/` calls the `Div` implementation for `f64`
        Length(self.0 / rhs.0, PhantomData)
    }
}

fn main() {
    // Computation for converting Inches to Millimeters
    // so 1 inch divided by 25.4 is equal to 0.0393701
    let dividend: Length = Length(1.0, PhantomData);
    let divisor: Length = Length(25.4, PhantomData);

    // `/` calls the `div()` method we implemented for `Length`
    let quotient = dividend / divisor;
    // 1 / 25.4 = 0.0393701
    // so 1 Millimeter is equal to 0.0393701 inch
    assert_eq!(quotient.0, 0.03937007874015748);
}

